<head>
    <meta charset="utf-8"/>
    <title> </title>
    <meta name="viewport" content="width=device-width,user-scalable=no,initial-scale=1,minimum-scale=1,maximum-scale=1"/>
    <meta name="ad.size" content="width=320,height=480">
    <meta name="apple-mobile-web-app-capable" content="yes"/>
    <meta name="apple-mobile-web-app-status-bar-style" content="black-translucent"/>
    <meta name="format-detection" content="telephone=no"/>
    <meta name="renderer" content="webkit"/>
    <meta name="force-rendering" content="webkit"/>
    <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1"/>
    <meta name="msapplication-tap-highlight" content="no"/>
    <meta name="screen-orientation" content="portrait"/>
    <meta name="x5-orientation" content="portrait"/>
    <meta name="x5-page-mode" content="app"/>
    <style type="text/css">
    * {margin:0;}
    video::-webkit-media-controls {display: none !important;}
    body {overflow: hidden !important;}
    body, canvas, div { -moz-user-select: none; -webkit-user-select: none; -ms-user-select: none; -khtml-user-select: none;}
    .loader_c {position: absolute;width: 100%;background:#fccf03;height: 100%;}
    .loader {width: 250px;height: 50px;line-height: 50px;text-align: center;position: absolute;top: 50%;left: 50%;transform: translate(-50%,-50%);font-weight: 900;color: #ce4233;letter-spacing: 0.2em;font-family: helvetica, arial;}
    .loader::before, .loader::after {content: "";display: block;width: 15px;height: 15px;background: #ce4233;position: absolute;animation: load .7s infinite alternate ease-in-out;}
    .loader::before {top: 0;}
    .loader::after {bottom: 0;}
    @keyframes load {
      0% {left: 0; height: 30px; width: 15px }
      50% {height: 8px; width: 40px }
      100% {left: 235px; height: 30px; width: 15px}
    }

    :root {
        	--logo-image: '';
        	--background-color1: #4E00BA;
          --background-color2: #170224;

        	--loader-color1: rgb(96, 255, 60);
        	--loader-color2: rgb(34, 180, 0);

        	--inset-shadow-color: rgba(34, 180, 0, 0.5);

        	--border-gradient-color1: rgb(2, 125, 196);
        	--border-gradient-color2: rgb(1, 86, 134);
        	--border-gradient-color3: rgb(0, 28, 44);
        }

    @keyframes loading {0% {background-position: 75% 100%;}100% {background-position: 100% 100%;}}
    .loader_c.custom {background: radial-gradient(circle, var(--background-color1) 0%, var(--background-color2) 80%);background-size: 100% 100%;}
    .loader.custom {top: 45%;height: 340px;background: var(--logo-image) top center/100% auto no-repeat;}
    .loader.custom:before {border-radius: 40px;width: 100%;height: 10px;margin: 0 auto;background-color: var(--link-color);background: linear-gradient(135deg, var(--loader-color1) 0%, var(--loader-color1) 30%, var(--loader-color2) 30.1%, var(--loader-color2) 60%, var(--loader-color1) 60.1%, var(--loader-color1) 100%);background-size: 20% 100%;background-repeat: repeat-x;box-shadow: inset 0px 3px 3px 1px var(--inset-shadow-color);top: 100%;z-index: 2;animation: loading 0.8s linear infinite;}
    .loader.custom:after {border-radius: 30px;top: calc(100% - 2px);left: -2px;width: calc(100% + 4px);height: 14px;animation: none;background: linear-gradient(0deg, var(--border-gradient-color1) 0%, var(--border-gradient-color2) 50%, var(--border-gradient-color3) 100%);background-size: 100% 100%;z-index: 0;}
    </style>
</head>
